CREATE DEFINER=`root`@`localhost` PROCEDURE `ActualizarCliente` (IN `dnis` CHAR(8), IN `dir` VARCHAR(60), IN `tel` VARCHAR(12), IN `Dep` VARCHAR(45), IN `Pro` VARCHAR(45), IN `Dis` VARCHAR(45), IN `usuario` VARCHAR(20))  BEGIN
	UPDATE persona SET Direccion=dir,Telefono=tel,
    IdDep=(SELECT ID FROM UBIGEO_PERU_DEPARTMENTS WHERE NAME=Dep),
    IdDist=(SELECT ID FROM UBIGEO_PERU_DISTRICTS WHERE NAME=Dis),
    IdPro=(SELECT ID FROM UBIGEO_PERU_PROVINCES WHERE NAME=Pro)
	WHERE DNI=dnis;
    UPDATE CUENTA SET USER=usuario
    WHERE IDCUENTA=(SELECT IDCUENTA FROM CLIENTE WHERE IDPERCLI=(SELECT IDPER FROM PERSONA WHERE DNI=dnis));
END$$

