CREATE DEFINER=`root`@`localhost` PROCEDURE `BuscarCliente` (IN `documento` CHAR(8))  BEGIN
  SELECT cliente.IdPerCli,persona.Nombre,persona.Apellidos,persona.Dni,persona.Direccion,persona.Telefono,persona.FechaNa,ubigeo_peru_departments.name,ubigeo_peru_provinces.name ,ubigeo_peru_districts.name,cuenta.user
FROM persona 
INNER JOIN cliente on cliente.IdPerCli = persona.IdPer
INNER JOIN cuenta on cuenta.IdCuenta = cliente.IdCuenta
INNER JOIN ubigeo_peru_departments on persona.IdDep= ubigeo_peru_departments.id 
INNER JOIN ubigeo_peru_provinces on persona.IdPro = ubigeo_peru_provinces.Id 
INNER JOIN ubigeo_peru_districts on persona.IdDist = ubigeo_peru_districts.id 
WHERE Dni = documento;
END$$

