CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_ACTUALIZARPASS` (IN `pas` VARCHAR(20), IN `dnis` CHAR(8))  BEGIN
	UPDATE CUENTA SET pass=pas WHERE IdCuenta=(SELECT C.IDCUENTA
        FROM EMPLEADO E
        INNER JOIN CUENTA C
        INNER JOIN PERSONA P
        ON E.IDPEREM=P.IDPER
        WHERE P.IDPER=(SELECT IDPER FROM PERSONA WHERE DNI=dnis) AND E.IDCUENTA=C.IDCUENTA);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_BUSCAREMPLEADO` (IN `dnis` CHAR(8))  BEGIN
	SELECT P.NOMBRE,P.APELLIDOS,P.DNI,P.DIRECCION,P.TELEFONO,P.FECHANA,D.NAME,PRO.NAME,DIS.NAME,C.USER,C.PASS,T.NOMBRE
	FROM EMPLEADO E
    INNER JOIN UBIGEO_PERU_DEPARTMENTS D
    INNER JOIN UBIGEO_PERU_PROVINCES PRO
    INNER JOIN UBIGEO_PERU_DISTRICTS DIS
    INNER JOIN CUENTA C
    INNER JOIN PERSONA P
    INNER JOIN TIPOEMPLEADO T
    ON E.IDPEREM=P.IDPER
    WHERE (P.DNI=dnis AND P.IDDEP=D.ID AND P.IDPRO=PRO.ID AND P.IDDIST=DIS.ID AND
    E.IDCUENTA=C.IDCUENTA AND E.IDTIP=T.IDTIP);
END$$

