CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_VALIDAR` (IN `usu` VARCHAR(20), IN `pas` VARCHAR(20))  BEGIN
	SELECT P.IDPER,P.NOMBRE,T.NOMBRE
                    FROM EMPLEADO E
                    INNER JOIN CUENTA C
                    INNER JOIN PERSONA P
                    INNER JOIN TIPOEMPLEADO T
                    ON E.IDPEREM=P.IDPER AND E.IDCUENTA=C.IDCUENTA AND E.IDTIP=T.IDTIP
                    WHERE C.USER LIKE usu AND C.PASS LIKE pas;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ValidarCliente` (IN `usu` VARCHAR(20), IN `pas` VARCHAR(20))  BEGIN
	SELECT P.IDPER,P.NOMBRE,C.USER
                    FROM CLIENTE CL
                    INNER JOIN CUENTA C
                    INNER JOIN PERSONA P
                    ON CL.IdPerCli=P.IDPER AND CL.IDCUENTA=C.IDCUENTA 
                    WHERE C.USER LIKE usu AND C.PASS LIKE pas;
END$$

